n      // this.getDetails(idProduct.id)\n  }\n\n  getDetails(idProduct:string){\n    this.subscription = this.productsService.getSpecificProducts(idProduct).subscribe({\n      next:(res)=>{\n        this.detailsProduct = res.data;\n        this.getRelatedProducts(this.detailsProduct.category._id)\n      },\n      error:(err)=>{\n      }\n    })\n  }\n\n  getRelatedProducts(categoryID:string){\n    this.productsService.getAllProducts(categoryID).subscribe({\n      next:(res)=>{\n        this.relatedProducts = res.data;\n      }\n    })\n\n  }\n\n\n  addToCart(id:string){\n    this.cartService.addProductToCart(id).subscribe({\n      next:(res)=>{\n    \n      this.cartService.numOfCart.set( res.numOfCartItems ) \n      if (res.status === \"success\") {\n        this.toastrService.success(res.message)\n      }\n      },error:(err)=>{\n\n      }\n    })\n  }\n\n\n  addToWishList(id:string):void{\n    this.wishListService.addProductToWishlist(id).subscribe({\n      next:(res)=>{\n    \n        if (res.status === \"success\") {\n          this.toastrService.success(res.message)\n        }\n      },\n      error:(err)=>{\n\n      }\n    })\n\n  }\n\n\n  ngOnDestroy(): void {\n      this.subscription.unsubscribe();\n  }\n  \n}\n    \n\n    \n        @if (detailsProduct) {\n    \n\n    Details Product:\n    \n        \n            \n    \n                @for (srs of detailsProduct.images ; track $index) {\n                    \n                        \n                            \n                        \n                    \n                }\n        \n            \n        \n        \n             {{detailsProduct.title}} \n             {{detailsProduct.description}} \n            \n                 {{detailsProduct.category.name}} \n                  \n            \n            \n                 {{  detailsProduct.price | currency:\"EGP \" }} \n                \n                    @for (num of [1,2,3,4,5].slice(0 , detailsProduct.ratingsAverage) ;track $index  ) {